        <div className="logged-film">
            <div>
                <div>{month}</div>
                <div>{month}</div>
                <div>{month}</div>
                </div>
            <div className="logged-film__description">
                <h2>{props.title}</h2>
                <div className="logged-film__rating">{props.rating}</div>
            </div>
        </div>
    )
}

export default LoggedFilm;
